const TableHeader = () => {

  return (
    <thead>
      <tr>
        <th>Name</th>
      </tr>
    </thead>
  );
};
const TableBody = () => {
  return <tbody />;
};

class Table extends Component {
  render(props) {
    const { studentNames } = this.props;
    return (
      <table>
        <TableHeader />
        <TableBody studentData={studentNames} />
      </table>
    );
  }
}
